import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import data from'./data';
import './index.css';

function ncard(val) {
	return(
		<Card
		key={val.id}
	imgsrc={val.imgsrc}
	title={val.title}
	sname={val.sname}
	link={val.link}
	/>
		);
	// body...
}

ReactDOM.render(<>
	<nav>
	<h1 className="head_style">A TOP FIVE WEB SERIES</h1>
	</nav>
	{data.map(ncard)}

	</>
	,document.getElementById("root"));
